import React, { Component } from "react";
import { Box } from "grommet";

const Navbar = props => (
  <Box
    tag="header"
    direction="row"
    align="center"
    justify="between"
    background="#FA9C1D"
    pad={{ left: "medium", right: "small", vertical: "small" }}
    elevation="medium"
    style={{ zIndex: "1" }}
    {...props}
  />
);

export default Navbar;
